('1472e8ca60dec1', 'SCImage', 'blueticket image', NULL, '0', '0', '1', NULL, 'SELECT * FROM zzsys_image ORDER BY sim_group, sim_code', 'zzsys_image', 'zzsys_image_id', '1', '1', '1', '', '', 'Add Image', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, '', '', 'tofile(trim       (''hello ''));\nif($recordID != $_POST[''recordID'']){ //--new record\n\n	$t = nuRunQuery("SELECT * FROM zzsys_image WHERE zzsys_image_id = ''$recordID'' ");\n	$r = db_fetch_object($t);\n\n	$s =      "UPDATE zzsys_image SET sim_code  = ''$r->sim_code'', ";\n	$s = $s . "sim_description  = ''$r->sim_description'', sim_group  = ''$r->sim_group''  ";\n	$s = $s . "WHERE zzsys_image_id = ''" . $_POST[''recordID'']  . "''";\n\n	nuRunQuery($s);\n	nuRunQuery("DELETE FROM zzsys_image WHERE zzsys_image_id = ''$recordID''");\n	\n	$recordID = $_POST[''recordID''];\n}\n\n\n\n', '', '0', 'function nuBeforeSave(){\n\n   if(document.getElementById("recordID").value == ''-1''){\n      alert("No Image has been uploaded");\n      return false;\n   }\n   return true;       \n\n}\n\nfunction nuLoadThis(){\n   document.getElementById(''theimage'').src=getImage(document.getElementById(''recordID'').value);\n}\n\nfunction nuAfterUpload(pRecordID){\n//   SaveThis(0);\n}', NULL, NULL, '0', '2007-11-05 13:53:18', '2007-11-15 08:32:22', '', NULL),
