('1456ca1f6158bc', 'object', '', '0', '', '1', 10, '', 'sob_zzsys_form_id', 'CREATE TABLE #TT# \r\n\r\nSELECT zzsys_form_id AS theid, CONCAT(sfo_name, '' (FORM)'') as thename FROM zzsys_form \r\nWHERE zzsys_form_id = ''index'';\r\n\r\nINSERT INTO #TT#  \r\n\r\nSELECT zzsys_form_id AS theid, CONCAT(sfo_name, '' (FORM)'') as thename FROM zzsys_form \r\nWHERE zzsys_form_id NOT IN (''object'',''form'')\r\nAND (zzsys_form.sys_setup != ''1''); \r\n\r\nINSERT INTO #TT#  \r\n\r\nSELECT zzsys_object_id, CONCAT(sfo_name, '' (FORM) '', sob_all_name, '' (SUBFORM)'')\r\nFROM zzsys_object INNER JOIN zzsys_form ON sob_zzsys_form_id = zzsys_form_id \r\nWHERE sob_all_type = ''subform''\r\nAND (zzsys_object.sys_setup != ''1'');', '', '', '', '', '', '', NULL, 5, 10, 'All', 'Displayed On', 'dropdown', NULL, '', NULL, 0, 0.00, 0, NULL, '', '', '', '', '', NULL, 0.00, '', '', 20.00, '0', '0', '0', 'SELECT * FROM #TT# order by thename', '', NULL, NULL, NULL, '', '', '', 0.00, '', '', '', '', 0, 0.00, NULL, '', NULL, '', '', 0.00, '', '', '', 0.00, '', NULL, '', '', '', '', '', '', '', NULL, NULL, 0, '', '', 0, 0, '', '', NULL, '', '', 0, 0, 0, NULL, NULL, '', 0.00, '', '', 5.00, NULL, '', '', '', '', NULL, '', '', 0.00, '', '', 0.00, '1', '2006-11-28 20:54:14', '2009-06-05 12:06:07', 'globeadmin'),
